  return (
    <>
      <div className="landing-page">
        <h3 className="title">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit .
        </h3>

        <div className="buttons">
          <a
            className="register"
            onClick={() => {
              navigate("/register");
            }}
            name="register"
          >
            Register
          </a>

          <a
            className="check-in"
            onClick={() => {
              navigate("/check-in");
            }}
            name="check-in"
          >
            Check-in
          </a>
          
        </div>
      </div>
    </>
  );
};

export default LandingPage;
